import React, { Component, useState } from 'react';
import reactDom from 'react-dom';
import CustomModal from './customModal';
import Modal from "react-bootstrap/Modal";
import Fade from 'react-reveal/Fade';
export default function PopupModal(props) {
const {handleNoClick, handleYesClick,setShowModal} = props;


    return (
        <div>
          <Fade duration={3000}>
      <Modal 
      style={{ width:  '900px' , height:'500px', position:'relative' }}
        {...props}
      contentClassName="popup-content"
      >

        <Modal.Body  style={{ width:  '900px' , height:'500px', position:'relative' }}
       >
          <h1>
              Still reading? 
          </h1>

          <button className="popupYes" onClick={() => handleYesClick()}>
                
          </button>

          <button className = "popupNo" onClick={() => handleNoClick()} > 

          </button>
          
        </Modal.Body>
      </Modal>
      </Fade>
      </div>
    );
  }
